    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>
    <style type="text/css">a, a > code {
color: rgb(249, 38, 114);
text-decoration: none;
}
.footnote {
position: absolute;
bottom: 3em;
padding-right: 4em;
font-size: 90%;
}
.remark-code-line-highlighted { background-color: #ffff88; }
.inverse {
background-color: #272822;
color: #d6d6d6;
text-shadow: 0 0 20px #333;

.inverse h1, .inverse h2, .inverse h3 {
color: #f3f3f3;
}

.left-column {
color: #777;
width: 20%;
height: 92%;
float: left;
}
.left-column h2:last-of-type, .left-column h3:last-child {
color: #000;
}
.right-column {
width: 75%;
float: right;
padding-top: 1em;
}
.pull-left {
float: left;
width: 47%;
}
.pull-right {
float: right;
width: 47%;
}
.pull-right + * {
clear: both;
}
img, video, iframe {
max-width: 100%;
}
blockquote {
border-left: solid 5px lightgray;
padding-left: 1em;
}
.remark-slide table {
margin: auto;
border-top: 1px solid #666;
border-bottom: 1px solid #666;
}
.remark-slide table thead th { border-bottom: 1px solid #ddd; }
th, td { padding: 5px; }
.remark-slide thead, .remark-slide tfoot, .remark-slide tr:nth-child(even) { background: #eee }
@page { margin: 0; }
@media print {
.remark-slide-scaler {
width: 100% !important;
height: 100% !important;
transform: scale(1) !important;
top: 0 !important;
left: 0 !important;
}
}

    <style type="text/css">.remark__tile-view * {
box-sizing: border-box;
}
.remark__tile-view {
background: lightgray;
position: relative;
width: 100%;
height: 100%;
padding: 3em;
font-size: 18px;
box-sizing: border-box;
overflow: scroll;
}
.remark__tile-view__header {
text-align: center;
}
.remark__tile-view__tiles {
display: grid;


justify-items: center;
}
.remark__tile-view__tile {
position: relative;
margin: 0.5em;
padding: 0.5em;
}
.remark__tile-view__slide-container {
margin: 0 auto;
}
.remark__tile-view__tile--current {
background: #ffd863;
border: 5px solid #ffd863;
margin: calc(0.5em - 5px);
border-radius: 0;
}
.remark__tile-view__tile--seen {
opacity: 0.5;
}
.remark__tile-view__tile:hover {

background: #44bc96;
opacity: 1;
}

    <script>/*
 *  Tile View for remark.js Slides
 *
 *  Garrick Aden-Buie
 *
 *  Inspired and converted to Vanilla JS from
 *  https://github.com/StephenHesperus/remark-hook/
 *
 *  Include after remarkjs slides are initialized.
 *
 */

/* global slideshow */
(function () {
  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const launchKey = 79 // keycode for O, used to enable tile view

    // Slides container
    const remarkSlideShow = document.querySelector('div.remark-slides-area')

    let tileView = document.querySelector('div.remark__tile-view')
    if (!tileView) {
      tileView = document.createElement('div')
      tileView.className = 'remark__tile-view'
    }

    const toggleElement = el => {
      el.style.display = el.style.display === 'none' ? '' : 'none'
    }

    function slideshowResize () {
      window.dispatchEvent(new Event('resize'))
    }

    const toggleTileView = function () {
      toggleElement(tileView)
      toggleElement(remarkSlideShow)

      if (tileView.style.display === 'none') {
        // tileView is now hidden, go to current slide
        slideshow.gotoSlide(tileVars.currentSlideIdx + 1)

        slideshow.resume()
        slideshowResize()
      } else {
        // store current slide index prior to launching tile-view
        tileVars.currentSlideIdx = slideshow.getCurrentSlideIndex()

        // set class on seen and current slide and scroll into view
        const tiles = tileView.querySelectorAll('.remark__tile-view__tile');
        [...tiles].forEach((tile, idx) => {
          tile.classList.toggle(
            'remark__tile-view__tile--seen',
            idx < tileVars.currentSlideIdx
          )
          tile.classList.toggle(
            'remark__tile-view__tile--current',
            idx === tileVars.currentSlideIdx
          )
        })
        tiles[tileVars.currentSlideIdx].scrollIntoView({
          behavior: 'smooth',
          block: 'center'
        })

        slideshow.pause()
      }
    }

    const createTileView = ({ minSize = 250, title = document.title } = {}) => {
      // Tile view header
      const h1 = document.createElement('h1')
      h1.className = 'remark__tile-view__header'
      h1.innerHTML = title

      tileView.appendChild(h1)
      const tiles = document.createElement('div')
      tiles.className = 'remark__tile-view__tiles'
      tileView.appendChild(tiles)

      // Clone slideshow
      const slidesArea = remarkSlideShow.cloneNode(true)

      // Calculate slide scale and tile container size
      const slideScaler = slidesArea.querySelector('.remark-slide-scaler')
      const slideWidth = parseFloat(slideScaler.style.width.replace('px', ''))
      const slideHeight = parseFloat(
        slideScaler.style.height.replace('px', '')
      )
      const scale = minSize / Math.min(slideWidth, slideHeight)
      let tileWidth = Math.round(slideWidth * scale)
      let tileHeight = Math.round(slideHeight * scale)

      // convert tileWidth/Height to em relative to base 18px (set in CSS)
      tileWidth = tileWidth / 18
      tileHeight = tileHeight / 18

      tiles.style.gridTemplateColumns = `repeat(auto-fill, minmax(${tileWidth}em, 1fr))`

      const slides = slidesArea.querySelectorAll('.remark-slide-container')

      slides.forEach((slide, slideIndex) => {
        let tile = document.createElement('template')
        tile.innerHTML = `<div class="remark__tile-view__tile">
            <div class="remark__tile-view__slide-container">
            </div></div>`
        tile = tile.content.firstChild

        const tileContainer = tile.querySelector(
          '.remark__tile-view__slide-container'
        )
        tileContainer.style.width = `${tileWidth}em`
        tileContainer.style.height = `${tileHeight}em`

        const thisSlideScaler = slide.querySelector('.remark-slide-scaler')
        thisSlideScaler.style.top = '0px'
        thisSlideScaler.style.left = '0px'
        thisSlideScaler.style.transform = `scale(${scale})`
        thisSlideScaler.parentElement.classList.add('remark-visible')

        slide.addEventListener('click', () => {
          tileVars.currentSlideIdx = slideIndex
          toggleTileView()
        })

        tileContainer.appendChild(slide)
        tiles.appendChild(tile)
      })

      document.body.appendChild(tileView)
    }

    const tileVars = {}

    document.addEventListener('keydown', ev => {
      if (ev.keyCode === launchKey) {
        toggleTileView()
      }
    })

    const addTileViewHelpText = () => {
      const helpTable = document.querySelector(
        '.remark-help-content table.light-keys'
      )
      if (!helpTable) {
        console.error(
          'Could not find remark help table, has remark been initialized?'
        )
        return
      }
      const newRow = document.createElement('tr')
      newRow.innerHTML += '<td><span class="key">o</span></td>'
      newRow.innerHTML += '<td>Tile View: Overview of Slides</td>'
      helpTable.append(newRow)
    }

    createTileView({ minSize: 200 })
    toggleElement(tileView)
    addTileViewHelpText()
  })
})()
</script>

    <script>/* global slideshow,window,document */
window.xaringanExtraClipboard = function (selector, text) {
  if (!window.ClipboardJS.isSupported()) return
  if (!window.xaringanExtraClipboards) window.xaringanExtraClipboards = {}

  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const {
      button: buttonText = 'Copy Code',
      success: successText = 'Copied!',
      error: errorText = 'Press Ctrl+C to Copy'
    } = text

    const template = '<button class="xaringanextra-clipboard-button" ' +
       `type="button" aria-label="Copy code to clipboard">${buttonText}</button>`

    const isRemarkSlideshow = typeof slideshow !== 'undefined' &&
      Object.prototype.hasOwnProperty.call(slideshow, 'getSlides')

    let siblingSelector = selector || 'pre'
    if (!selector && isRemarkSlideshow) {
      siblingSelector = '.remark-slides-area ' + siblingSelector
    }

    // insert <button>s
    document.querySelectorAll(siblingSelector).forEach(el => {
      if ([/^$/, 'inherit', 'unset', 'revert', 'static'].some(p => el.style.position.match(p))) {
        el.style.position = 'relative'
      }
      el.insertAdjacentHTML('beforeend', template)

      // match button text color to code color
      const currentColor = window.getComputedStyle(el.children[0]).getPropertyValue('color')
      el.querySelector('button.xaringanextra-clipboard-button').style.color = currentColor
    })

    // initialize cliboardjs
    const clipboard = new window.ClipboardJS(siblingSelector + ' .xaringanextra-clipboard-button', {
      text: function (trigger) {
        // temporarily remove the button text
        // so that it isn't included in the text that's copied
        const btnLabel = trigger.innerHTML
        trigger.innerHTML = ''
        // snapshot text of copy button's parent element
        const text = trigger.parentElement.innerText
        // restore the button's inner HTML
        trigger.innerHTML = btnLabel
        return text
      }
    })

    // show success text for 2.5 seconds on success
    clipboard.on('success', function (ev) {
      ev.trigger.innerHTML = successText
      ev.trigger.style.display = 'block'
      setTimeout(function () {
        ev.trigger.innerHTML = buttonText
        ev.trigger.style.display = ''
      }, 2500)
      ev.clearSelection()
    })

    // show error text for 2.5 seconds on error
    clipboard.on('error', function (ev) {
      ev.trigger.innerHTML = errorText
      setTimeout(function () { ev.trigger.innerHTML = buttonText }, 2500)
    })

    // block remark click/touch slide change event listeners
    if (isRemarkSlideshow) {
      ['touchstart', 'touchend', 'touchmove'].forEach(function (evType) {
        document.querySelector('.remark-slides-area').addEventListener(evType, function (ev) {
          if (!ev.target.closest('pre')) return
          if (ev.target.closest('pre').querySelector('.xaringanextra-clipboard-button')) {
            ev.stopPropagation()
          }
        })
      })
    }

    window.xaringanExtraClipboards[siblingSelector] = clipboard
  })
}

class: center, middle
# Please, let me in (authentication)

---



## Local or remote &amp; HTTPS or SSH?

- A Git project is stored in a repository, which can be local or remote

- When using Git to access a remote repository (for backup or collaborative
work) on a remote server, you need to authenticate yourself to the server

- There are two ways of authentication: HTTPS or SSH

---


## Choose a remote server

- GitHub (which will be using)

- GitLab

- ...

---

## GitHub: Using personal access tokens

- These days, [authentication via personal access tokens (PAT) (and
https)](https://happygitwithr.com/https-pat.html) seems the way to go when using
GitHub

- In the following, I will illustrate the process using multiple screenshots

- Note that my explanation does not include any R/RStudio-related processes.
Johannes will talk about these things in more detail

---


## 

In GitHub, go to the `Settings` website:

&lt;img src=&quot;data:image/png;base64,#../img/f_github-pat-0-settings.png&quot; width=&quot;55%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---


## 

Next, go to the `Developer Settings` entry: 

&lt;img src=&quot;data:image/png;base64,#../img/f_github-pat-1-settings.png&quot; width=&quot;90%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---


## 

Then, choose `Tokens (classic)`:

&lt;img src=&quot;data:image/png;base64,#../img/f_github-pat-2-developer.png&quot; width=&quot;90%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---


## 

And, generate a new token; important, save this Token (e.g.,
`ghp_FqamoGsx6PcEnpwnXyh...`):

&lt;img src=&quot;data:image/png;base64,#../img/f_github-pat-3-create-token.png&quot; width=&quot;90%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---


## 

When you are now cloning a new repository (or pushing/pulling for the first
time), you will be asked once to enter your username...

&lt;img src=&quot;data:image/png;base64,#../img/f_github-pat-4-enter-credent.png&quot; width=&quot;90%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---


## 

... and your Token (even though it says &quot;Password&quot;):

&lt;img src=&quot;data:image/png;base64,#../img/f_github-pat-4-enter-credent2.png&quot; width=&quot;90%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---


## 

If, for whatever reason, you decide to reset/remove your credentials, you can do so
using the [Windows Credentials
Manager](https://support.microsoft.com/en-us/windows/accessing-credential-manager-1b5c916a-6a16-889f-8581-fc16e8165ac0)
(in German: &quot;Anmeldeinformationsverwaltung&quot;)


&lt;img src=&quot;data:image/png;base64,#../img/f_github-pat-5-wincred.png&quot; width=&quot;70%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---


## Setting up SSH

- SSH is a network protocol that comes in handy, when you work with remote
repositories and when you do not want to type-in your passwort every time you
pull (fetch) or push (send) from a remote repository. You still need to
authenticate yourself, though.

- To work with Git on you local computer, you do not need SSH (= Secure Shell). 

- Authentication in SSH (which is also the name of the program) works by using a
private and a public key (usually the public key has the file extension `.pub`,
e.g., my public key is `id_rsa.pub`). When you start working with SSH for the
very first time, you have to create both keys.

---


## 

- The private key remains on your local computer and you have to make sure that
it is safe -- it is a simple text file and it is your password now, and everyone
who has your private key can access your files. Again, everyone who has your
private key has your password!

This is what my *public key* looks like:

    ssh-rsa
    AAAAB3NzaC1yc2EAAAABIwAAAQEAyOQ9RT6TkfgkdO2NspzdVJE5CZ03yYAhVwLGo
    CrI3E9/Ix0MAySunXExjhsQi2XkhPBjLOEahYuuLaAWHuBc7apUPRNSBy+mdUHnH3
    0BdTQijQ6vj3RL99HO4yrZnipIlkS5ufw/+hpbXXOzSOqTvyGtL9ygm3eA2HDSQtz
    2ptFq8anODJDKrgTbNLb/YZ9KDIcpdO/Sfk4LtvaGF3tIFlyE+pogNmN4eWiYg9Xv
    25BhVVxWMHadRFLeDastWO4SedriEHzQYaNgxVNTufqolJ0nbg4R//fVDxjR2SbzV
    AHLZ+eVPUx+vzcPVMP9wYPcnii9YLiSRy+hlUAOR/kXeQ== berndweiss

---


class: middle
## 

**The *public key* (not the private key!) has to be stored at the
GitHub/GitLab/... website. Now, everyone who has your public key can encrypt
files (that are sent to you via the internet) but only you (or anyone else who
has your private key) can decrypt the files. And, for that reasons you do not
have to login everytime you push/pull files from the remote repository.**

---


## 

- How to setup SSH on you computer is explained on this website:
https://docs.gitlab.com/ce/ssh/README.html (&quot;Generate an SSH key pair&quot;)

- The most important point is that `ssh` is able to find your key pair, i.e., it
needs to be located in your HOME folder

If everything works well, you should receive the following friendly welcome
message after typing in the command `ssh -T git@github.com`:

&gt; Hi berndweiss! You&#39;ve successfully authenticated, but GitHub does not provide shell access.

---


## Exercise

- In a previous exercise (see [](git:exercise1)), you have created your own repository (let&#39;s call it `your-new-repo`)

- Now, go to your GitHub account and create a new repository on GitHub 
    - Startpage -&gt; tab &quot;Repositories&quot; -&gt; green button &quot;New&quot;
    - Enter a new &quot;Repository name&quot;
    - Make it &quot;Private&quot; (unless you have something important to share)
    - Do **not** check any of the &quot;Initialize this repository with&quot; boxes
    - Hit the green &quot;Create repository&quot; button
    - Choose SSH or HTTPS as protocol (&quot;Quick setup — if you’ve done this kind of thing before&quot;)
    - Look for &quot;...or push an existing repository from the command line&quot;
    - SSH:
        - Copy the line `git remote add origin git@github.com:berndweiss/your-repo-name.git` 
        - Execute the command `git remote add origin git@github.com:berndweiss/your-repo-name.git` in the Git Bash in your local repository (`your-new-repo`)
    - HTTPS:
        - Copy the line `git remote add origin https://github.com/berndweiss/your-repo-name.git` 
        - Execute the command `git remote add origin https://github.com/berndweiss/your-repo-name.git` in the Git Bash in your local repository (`your-new-repo`)
    - Make sure that `git status` shows a clean repository
    - Now you can run your first `git push origin main`
    - Reload the GitHub page via F5; you now should see the content of your local repo `your-new-repo`
    - ...
    - You can delete a GitHub repository via the tab &quot;Settings&quot; -&gt; &quot;Options&quot;, then scroll down -&gt; &quot;Danger Zone&quot; -&gt; &quot;Delete this repository&quot;

---
